// NavBar.js

import React from 'react';
import { Link } from 'react-router-dom';

function NavBar() {
  return (
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/factures">Factures</Link></li>
        {/* Add more navigation items as needed */}
      </ul>
    </nav>
  );
}

export default NavBar;
